import style from './Card.module.css';

const Card = ({name, image, types, id}) => {
    return(
        <div className={style.container}>
            <p>{id}</p>
            <img src={image} alt='F'/>
            <h3>{name}</h3>
            <p>{types}</p>
        </div>
    )
}

export default Card;
